import "./Navbar.scss"

function Navbar() {
    return (
        <nav className="nav">
            <ul className="nav-list">
                <li className="nav-list-item"></li>
                <li className="nav-list-item"></li>
                <li className="nav-list-item"></li>
            </ul>
        </nav>
    );
}

export default Navbar
